{userData.image ? (
  <p
    className="cursor-pointer text-black px-2 hover:bg-yellow-400"
    onClick={handleLogout}
  >
    Logout ({userData.firstName}){" "}
  </p>
) : (
  <Link
    to={"login"}
    className="whitespace-nowrap cursor-pointer hover:bg-yellow-400 px-2  text-black"
  >
    Login
  </Link>
)}
